?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта часовая компания берет свое начало с 1914 года. Создатель компании Юджин Мейлан великолепный мастер, явился так же создателем первого тонкого механизма, который используется для женских часов. А уже в 1931 году он сделал часы с автоматическим подзаводом. В 1934 году часы марки Glycine приобрели полное соответствие с Официальной Швейцарской Проверкой. Даже во время Второй Мировой Glycine не свернула производство. Кроме этого, марка выступила на Базельской выставке. Компания Glycine производит, в большинстве своем, спортивные часы. В 1948 году компания произвела первые самозаводящиеся часы. Но внимание часового общества они привлекли, когда Glycine выпустила часы Airman 2000. Это были первые часы, которые показывали время одновременно в 3-х часовых зонах. Каждые из них имеют свой индивидуальный номер, что доказывает эксклюзивность этих часов. На сегодняшний день Glycine –это незаурядная компания, которая умеет сочетать современность со швейцарскими традициями и обладающая тонким вкус.</span></span></p>
 
